var court_ui=(()=>{frappe.provide("court_ui.utils.theme");court_ui.utils.theme={isDarkMode:()=>window.matchMedia("(prefers-color-scheme: dark)").matches,toggleTheme:()=>{let e=document.documentElement,t=court_ui.utils.theme.isDarkMode();Object.entries({light:{"--background-color":"#f8fafc","--text-color":"#1a202c"},dark:{"--background-color":"#1a202c","--text-color":"#f8fafc"}}[t?"dark":"light"]).forEach(([o,r])=>{e.style.setProperty(o,r)})}};})();
